import React from 'react';

const ProductTile = ({ product, onAddToCart }) => {
    return (
        <div className="product-tile">
            <h3>{product.title}</h3>
            <p>{product.description}</p>
            <button onClick={() => onAddToCart(product)}>Add to Cart</button>
        </div>
    );
};

export default ProductTile;
